import React, { useState } from 'react';
import { Container, Button, Collapse } from 'react-bootstrap';
import './AdminPage.css';

const AdminPage = () => {
    const [seccionVisible, setSeccionVisible] = useState(false);

    const toggleSeccion = () => setSeccionVisible(!seccionVisible);
    const cerrarSeccion = () => setSeccionVisible(false);

    return (
        <div className='boton-flotante'>
            <button type='button' onClick={toggleSeccion}>boton</button>
            {seccionVisible && <SeccionExpandida/>}
        </div>

    );
};

const SeccionExpandida = () => {
    return (
        <div className='seccion-expandida'>
            <p>Alli esta el Tiburon, Alli esta</p>
        </div>
    );
};

export default AdminPage;
